import React, { useState } from 'react';
import ''
import { Search, Home, BookOpen, Clock, Bookmark, Menu, Plus } from 'lucide-react';

const LibraryDashboard = () => {
  const [selectedCategory, setSelectedCategory] = useState('Drama');
  
  const categories = ['Drama', 'Family', 'Education', 'Technology', 'Science', 'Arts'];
  
  const featuredContent = [
    { id: 1, title: "Deadpool & Wolverine", type: "NEWLY ADDED", image: "/api/placeholder/280/400" },
    { id: 2, title: "Lost Treasures", type: "NEW RELEASE", image: "/api/placeholder/280/400" },
    { id: 3, title: "Endurance", type: "NEWLY ADDED", image: "/api/placeholder/280/400" },
    { id: 4, title: "National Geographic", type: "NEW RELEASE", image: "/api/placeholder/280/400" }
  ];

  return (
    <div className="bg-[#0F1014] min-h-screen">
      {/* Left Sidebar */}
      <div className="fixed left-0 top-0 h-full w-16 bg-[#1A1C21] flex flex-col items-center py-6 space-y-8">
        <img 
          src="/api/placeholder/40/40" 
          alt="Logo" 
          className="w-10 h-10 rounded-full mb-8"
        />
        <div className="flex flex-col space-y-8">
          <Home className="w-6 h-6 text-gray-400 hover:text-white cursor-pointer" />
          <Search className="w-6 h-6 text-gray-400 hover:text-white cursor-pointer" />
          <BookOpen className="w-6 h-6 text-gray-400 hover:text-white cursor-pointer" />
          <Clock className="w-6 h-6 text-gray-400 hover:text-white cursor-pointer" />
          <Bookmark className="w-6 h-6 text-gray-400 hover:text-white cursor-pointer" />
        </div>
      </div>

      {/* Main Content */}
      <div className="ml-16 p-6">
        {/* Top Header */}
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-3xl font-bold text-white">Digital Library</h1>
          <div className="flex items-center space-x-4">
            <button className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-md flex items-center">
              <Plus className="w-5 h-5 mr-2" />
              Subscribe
            </button>
          </div>
        </div>

        {/* Hero Section */}
        <div className="relative rounded-xl overflow-hidden mb-8 h-[400px]">
          <img 
            src="/api/placeholder/1200/400" 
            alt="Featured" 
            className="w-full h-full object-cover"
          />
          <div className="absolute bottom-0 left-0 right-0 p-8 bg-gradient-to-t from-black to-transparent">
            <div className="max-w-2xl">
              <h2 className="text-4xl font-bold text-white mb-4">Featured Content</h2>
              <p className="text-gray-200 mb-6">Discover our latest collection of educational resources and learning materials.</p>
              <div className="flex space-x-4">
                <button className="bg-blue-600 hover:bg-blue-700 text-white px-6 py-3 rounded-md">
                  Start Learning
                </button>
                <button className="bg-gray-800 hover:bg-gray-700 text-white px-6 py-3 rounded-md">
                  Learn More
                </button>
              </div>
            </div>
          </div>
        </div>

        {/* Categories */}
        <div className="mb-8">
          <div className="flex space-x-6 mb-6">
            {categories.map((category) => (
              <button
                key={category}
                onClick={() => setSelectedCategory(category)}
                className={`text-lg ${
                  selectedCategory === category
                    ? 'text-white font-semibold'
                    : 'text-gray-400 hover:text-white'
                }`}
              >
                {category}
              </button>
            ))}
          </div>
        </div>

        {/* Featured Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
          {featuredContent.map((item) => (
            <div key={item.id} className="relative group cursor-pointer">
              <img
                src={item.image}
                alt={item.title}
                className="w-full h-[400px] object-cover rounded-lg transition-transform duration-300 group-hover:scale-105"
              />
              <div className="absolute top-3 right-3 bg-blue-600 text-white text-xs px-2 py-1 rounded">
                {item.type}
              </div>
              <div className="absolute bottom-0 left-0 right-0 p-4 bg-gradient-to-t from-black rounded-b-lg">
                <h3 className="text-white font-semibold text-lg">{item.title}</h3>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default LibraryDashboard;
